import React from "react";

function Links() {
    return (
        <div className="App">
          <header className="App-header">
                <a
                    className="App-link"
                    href="https://www.linkedin.com/in/alex-truxess-7702b1170"
                    target="_blank"
                    rel="noopener noreferrer"
                    >
                    <div className="chicago">LinkedIn</div>
                </a>
            </header>
        </div>
    );
}

export default Links;
